pragma solidity ^0.5.0;

import "../node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721Full.sol";
import "../node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721Burnable.sol";
import "./AkTL.sol";

contract PostdatedCheckManager is ERC721Full, ERC721Burnable {
    uint256 private _cost;
    uint256 private _lastTokenId;

    event LogCustomer(address indexed customer, bool isAdded);
    event LogCheck(address indexed customer, uint256 indexed tokenId);
    event LogPayment(uint256 indexed tokenId, address owner);
    event LogCost(uint256 newCost);

    struct PostdatedCheck {
        address creator;
        uint256 date;
        uint256 amount;
    }
    mapping(uint256 => PostdatedCheck) private _postdateChecks;

    // Mapping from customer to list of customer token IDs
    mapping(address => uint256[]) private _customerTokens;

    // Mapping from token ID to index of the customer tokens list
    mapping(uint256 => uint256) private _customerTokensIndex;

    string private _tokenURI;
    address private _bank;
    AkTL public _akTL;
    modifier onlyBank() {
        require(msg.sender == _bank, "Unauthorized");
        _;
    }

    mapping(address => bool) private _customers;
    modifier onlyCustomer() {
        require(_customers[msg.sender] == true, "Unauthorized");
        _;
    }

    constructor(string memory name, string memory symbol, string memory tokenURI, address akTLAddress, uint256 cost) public 
        ERC721Full(name, symbol) {
        _bank = msg.sender;
        _tokenURI = tokenURI;
        _cost = cost;
        _akTL = AkTL(akTLAddress);
    }

    function isBank() public view returns(bool) {
        return (msg.sender == _bank);
    }

    function addCustomer(address customer) public onlyBank {
        _customers[customer] = true; 
        emit LogCustomer(customer, true);
    }

    function revokeCustomer(address customer) public onlyBank {
        _customers[customer] = false; 
        emit LogCustomer(customer, false);
    }

    function isCustomer(address customer) public view returns(bool)  {
        return _customers[customer]; 
    }

    function setCost(uint256 newCost) public onlyBank {
        _cost = newCost; 
        emit LogCost(newCost);
    }

    function createCheck(address to, uint256 date, uint256 amount) public onlyCustomer {
        uint256 tokenId = _lastTokenId++;
        _mint(to, tokenId);
        _setToken(tokenId, msg.sender, date, amount);
        _addTokenToCustomerEnumeration(msg.sender, tokenId);
        emit LogCheck(msg.sender, tokenId);
    }

    function tokenURI(uint256) external view returns (string memory) {
        return _tokenURI;
    }

    function checkInfo(uint256 tokenId) external view returns (address creator, uint256 date, uint256 amount, address owner) {
        require(_exists(tokenId), "Invalid tokenId");
        PostdatedCheck memory check = _postdateChecks[tokenId];
        return (check.creator, check.date, check.amount, ownerOf(tokenId));
    }

    function tokensOfCustomer(address customer) public view returns (uint256[] memory) {
        return _customerTokens[customer];
    }

    function tokensOfOwner(address owner) public view returns (uint256[] memory) {
        return _tokensOfOwner(owner);
    }

    function _setToken(uint256 tokenId, address creator, uint256 date, uint256 amount) internal {
        require(_exists(tokenId), "Invalid tokenId");
        _postdateChecks[tokenId] = PostdatedCheck(creator, date, amount);
    }

    function pay(uint256 tokenId) public returns (bool) {
        _pay(tokenId);
        emit LogPayment(tokenId, msg.sender);
        return true;
    }

    function _pay(uint256 tokenId) private {
        require(ownerOf(tokenId) == msg.sender, "Not authorized");
        require(_postdateChecks[tokenId].date < block.timestamp, "Early to pay!");

        require(
            _akTL.transferFrom(_postdateChecks[tokenId].creator, ownerOf(tokenId), _postdateChecks[tokenId].amount), 
            "Amount tranfer failed"
        );
        require(
            _akTL.transferFrom(_postdateChecks[tokenId].creator, _bank, _cost), 
            "Cost transfer failed"
        );

        burn(tokenId);
    }

    function _burn(address owner, uint256 tokenId) internal {
        super._burn(owner, tokenId);

        // Clear metadata (if any)
        if (_postdateChecks[tokenId].creator != address(0)) {
            _removeTokenFromCustomerEnumeration(_postdateChecks[tokenId].creator, tokenId);
            // Since tokenId will be deleted, we can clear its slot in _customerTokensIndex to trigger a gas refund
            _customerTokensIndex[tokenId] = 0;

            delete _postdateChecks[tokenId];
        }
    }

    function _addTokenToCustomerEnumeration(address to, uint256 tokenId) private {
        _customerTokensIndex[tokenId] = _customerTokens[to].length;
        _customerTokens[to].push(tokenId);
    }

    function _removeTokenFromCustomerEnumeration(address from, uint256 tokenId) private {
        // To prevent a gap in from's tokens array, we store the last token in the index of the token to delete, and
        // then delete the last slot (swap and pop).

        uint256 lastTokenIndex = _customerTokens[from].length.sub(1);
        uint256 tokenIndex = _customerTokensIndex[tokenId];

        // When the token to delete is the last token, the swap operation is unnecessary
        if (tokenIndex != lastTokenIndex) {
            uint256 lastTokenId = _customerTokens[from][lastTokenIndex];

            _customerTokens[from][tokenIndex] = lastTokenId; // Move the last token to the slot of the to-delete token
            _customerTokensIndex[lastTokenId] = tokenIndex; // Update the moved token's index
        }

        // This also deletes the contents at the last position of the array
        _customerTokens[from].length--;

        // Note that _ownedTokensIndex[tokenId] hasn't been cleared: it still points to the old slot (now occcupied by
        // lasTokenId, or just over the end of the array if the token was the last one).
    }
}
